import './App.css';
import {BrowserRouter, Route, Switch} from "react-router-dom"
import Landing from "./components/Landing"
import Home from './components/Home';

function App() {
  return (
<BrowserRouter>

    <div className="App">

      <Route path="/" component={<Landing/>}/>
      <Route path="/home" component={Home}/>

    </div>

    </BrowserRouter>
  );
}

export default App;
